import defaultLanguage from "./language/default.json";
import ru from "./language/ru.json";
const getTranslate = (language, element) => {
  let languageObject;
  if (language === "ru") {
    languageObject = ru;
  } else {
    languageObject = defaultLanguage;
  }

  return languageObject[element];
};

